/// <summary>
///     ATTENTION: If doing visual design changes on this form ensure the same visual changes are done on InventTransRegister form.
/// </summary>
    [Form]
    public class TradeNonStockedRegister extends FormRun
    {
        SalesPurchLine                              callerOrderLine;
        TradeNonStockedRegisterForm                 tradeNonStockedRegisterForm;

}

/// <summary>
/// Calculates item quantity based on <c>TradeNonStockedRegisterTmp</c> record.
/// </summary>
/// <param name="_tradeNonStockedRegisterTmp">
///  A <c>TradeNonStockedRegisterTmp</c> record.
/// </param>
/// <returns>
/// Calculated item quantity.
/// </returns>
public TradeNonStockedRegisterNowQty calcTradeNonStockedRegisterTmpQuantity(TradeNonStockedRegisterTmp _tradeNonStockedRegisterTmp)
{
    return _tradeNonStockedRegisterTmp.StatusReceipt == StatusReceipt::Ordered? _tradeNonStockedRegisterTmp.Quantity : -_tradeNonStockedRegisterTmp.Quantity;
}

/// <summary>
/// Creates a record in the <c>TradeNonStockedRegisterTmp</c> table based on the given parameters.
/// </summary>
/// <param name="_tradeNonStockedRegisterTmp">
/// A <c>TradeNonStockedRegisterTmp</c> table instance into which the record is to be inserted.
/// </param>
/// <param name="_splitQty">
/// The quantity that is to be set for the new record.
/// </param>
void createPendingQuantityUpdated(TradeNonStockedRegisterTmp _tradeNonStockedRegisterTmp, TradeNonStockedRegisterNowQty _splitQty)
{
    _tradeNonStockedRegisterTmp.Quantity = _tradeNonStockedRegisterTmp.Quantity - _splitQty;
    _tradeNonStockedRegisterTmp.update();

    tradeNonStockedRegisterForm.insertFromTradeNonStockedRegisterTmp(tradeNonStockedRegisterTmp, _tradeNonStockedRegisterTmp, _splitQty);

    tradeNonStockedRegisterTmp_Ds.executeQuery();
}

/// <summary>
/// Invokes research on the <c>TradeNonStockedRegisterTmp</c> data sources.
/// </summary>
/// <param name="_resetTmpInventTransWMS">
/// A boolean value specifying if the updated  <c>TradeNonStockedRegisterTmp</c> data source should be reset.
/// </param>
void doResearch(boolean _resetTmpInventTransWMS = false)
{
    tradeNonStockedRegisterTmp_ds.research();

    if (_resetTmpInventTransWMS)
    {
        delete_from tradeNonStockedRegisterTmpUpdated;
        tradeNonStockedRegisterTmpUpdated_ds.research();
        TradeNonStockedRegisterTmpUpdated_ds.enableActions(false);
    }

    pendingQuantityGrid.setFocus();

    if (referenceGroupPurch.visible())
    {
        purchLine_ds.reread();
    }
    else
    {
        salesLine_ds.refresh();
    }
}

/// <summary>
/// Initialises the form by populating the registered and ordered quantities for the order line.
/// </summary>
void init()
{
    super();

    if (!element.args().dataset())
    {
        throw error(strFmt("@SYS22678",element.name()));
    }

    callerOrderLine  = element.args().record();

    tradeNonStockedRegisterForm = TradeNonStockedRegisterForm::newFromSalesPurchLine(callerOrderLine);
    tradeNonStockedRegisterForm.populatePendingQuantityRows(tradeNonStockedRegisterTmp);

    TradeNonStockedRegisterTmpUpdated_ds.enableActions(false);

    switch (callerOrderLine.TableId)
    {
        case tableNum(PurchLine) :
            referenceGroupPurch.visible(true);
            referenceGroupSales.visible(false);
            break;

        case tableNum(SalesLine) :
            referenceGroupPurch.visible(false);
            referenceGroupSales.visible(true);
            break;

        default :
            throw error(Error::missingRecord("@SYS319733"));
    }
}

/// <summary>
/// Updates the form design based on the active inventory dimensions.
/// </summary>
/// <param name="_mode">
/// A <c>InventDimFormDesignUpdate</c> value specifying if the design is to be initialised or updated.
/// </param>
void updateDesign(InventDimFormDesignUpdate _mode)
{
    if (callerOrderLine.salesPurchLineInterface().isStocked())
    {
        this.close();
    }

    if (callerOrderLine.salesPurchLineInterface().isCategoryBased())
    {
        this.updateDesignCategoryBasedLines();
    }
    else
    {
        tradeNonStockedRegisterForm.updateInventDimFormsetup(_mode, element);
    }
}

/// <summary>
/// Updates design for category based lines by enabling the site and warehouse inventory dimensions.
/// </summary>
private void updateDesignCategoryBasedLines()
{
    ListEnumerator  enumerator = InventDim::dimFieldListEnumerator();
    FieldId         dimFieldId;

    while (enumerator.moveNext())
    {
        dimFieldId = enumerator.current();
        switch (dimFieldId)
        {
            case fieldNum(InventDim, InventSiteId),
                 fieldNum(InventDim, InventLocationId):
                inventDim_DS.object(dimFieldId).visible(true);
                inventDimUpdated_DS.object(dimFieldId).visible(true);
                break;
            default:
                inventDim_DS.object(dimFieldId).visible(false);
                inventDimUpdated_DS.object(dimFieldId).visible(false);
                break;
        }
    }
}

public void autoTmpCreate(TradeNonStockedRegisterTmp _tradeNonStockedRegisterTmp)
{
    tradeNonStockedRegisterForm.insertFromTradeNonStockedRegisterTmp(tradeNonStockedRegisterTmpUpdated, _tradeNonStockedRegisterTmp,
            element.calcTradeNonStockedRegisterTmpQuantity(_tradeNonStockedRegisterTmp), true);

    tradeNonStockedRegisterTmpUpdated_DS.executeQuery();
}

public int active()
{
    int ret;

    ret = super();

    splitButton.enabled(tradeNonStockedRegisterTmp.SourceDocumentLine);

    element.updateDesign(InventDimFormDesignUpdate::Active);

    return ret;
}

/// <summary>
/// Enables registration actions based on specified order pending quantity.
/// </summary>
/// <param name = "_fromCreate"> True, if the action gets called during <c>TradeNonStockedRegisterTmpUpdated</c> record creation; otherwise - false.</param>
public void enableActions(boolean _fromCreate)
{
    boolean allowPost = TradeNonStockedRegisterTmp.Quantity != 0;

    if (_fromCreate)
    {
        RegisterButton.enabled(allowPost);
        DeleteButton.enabled(allowPost);
    }
    else
    {
        RegisterButton.enabled(allowPost && TradeNonStockedRegisterTmpUpdated.RecId != 0);
        DeleteButton.enabled(TradeNonStockedRegisterTmpUpdated.RecId || TradeNonStockedRegisterTmpUpdated.Quantity);
    }
}

public void create(boolean _append = false)
{
    super(_append);

    tradeNonStockedRegisterTmpUpdated.Quantity = element.calcTradeNonStockedRegisterTmpQuantity(tradeNonStockedRegisterTmp);

    inventDimUpdated.data(InventDim::find(tradeNonStockedRegisterTmp.InventDimId));
    inventDimUpdated_DS.refresh();

    TradeNonStockedRegisterTmpUpdated_ds.enableActions(true);
}

public int active()
{
    int ret;

    ret = super();

    TradeNonStockedRegisterTmpUpdated_ds.enableActions(!TradeNonStockedRegisterTmpUpdated.RecId);

    return ret;
}

[SysClientCacheDataMethodAttribute]
display UnitQty registerRemain()
{
    return purchLine.orderedInPurchUnit() - tradeNonStockedRegisterForm.parmTotalRegisterNow();
}

public void linkActive()
{
    element.updateDesign(InventDimFormDesignUpdate::Init);

    super();
}

display InventTransType inventTransType()
{
    return InventTransType::Purch;
}

public void executeQuery()
{
    QueryBuildDataSource    qbds;
    QueryBuildRange         qbr;

    qbds = purchLine_DS.query().dataSourceTable(tableNum(PurchLine));
    qbr = SysQuery::findOrCreateRange(qbds, fieldNum(PurchLine,InventTransId));
    qbr.value(callerOrderLine.salesPurchLineInterface().parmInventTransId());

    super();
}

public void init()
{
    super();

    purchLine_DS.query().dataSourceTable(tableNum(PurchLine)).clearDynalinks();
}

public void init()
{
    super();

    salesLine_DS.query().dataSourceTable(tableNum(SalesLine)).clearDynalinks();
}

public void executeQuery()
{
    QueryBuildDataSource    qbds;
    QueryBuildRange         qbr;

    qbds = salesLine_DS.query().dataSourceTable(tableNum(SalesLine));
    qbr = SysQuery::findOrCreateRange(qbds, fieldNum(SalesLine,InventTransId));
    qbr.value(callerOrderLine.salesPurchLineInterface().parmInventTransId());

    super();
}

display InventTransType inventTransType()
{
    return InventTransType::Sales;
}

public void linkActive()
{
    element.updateDesign(InventDimFormDesignUpdate::Init);

    super();
}

[SysClientCacheDataMethodAttribute]
display UnitQty registerRemain()
{
    return salesLine.onOrderInSalesUnit() - tradeNonStockedRegisterForm.parmTotalRegisterNow();
}

public void clicked()
{
    TradeNonStockedRegisterTmp marked = tradeNonStockedRegisterTmp_ds.getFirst(1);

    if (marked)
    {
        do
        {
            element.autoTmpCreate(marked);

            marked = tradeNonStockedRegisterTmp_ds.getNext();
        }
        while (marked);
    }
    else
    {
        element.autoTmpCreate(tradeNonStockedRegisterTmp);
    }
}

void clicked()
{
    try
    {
        tradeNonStockedRegisterForm.register(tradeNonStockedRegisterTmpUpdated);
    }
    catch(Exception::Error)
    {
        tradeNonStockedRegisterForm.populatePendingQuantityRows(tradeNonStockedRegisterTmp);

        element.doResearch(true);

        throw(Exception::Error);
    }

    tradeNonStockedRegisterForm.populatePendingQuantityRows(tradeNonStockedRegisterTmp);

    element.doResearch(true);

    super();
}

void clicked()
{
    if (Box::yesNo("@SYS53772",DialogButton::No) == DialogButton::Yes)
    {
        delete_from tradeNonStockedRegisterTmpUpdated;
        tradeNonStockedRegisterForm.resetRegisterNow();

        element.doResearch(true);
    }

    super();
}
